\section*{question:}
durch was unterscheiden sich akne vulgaris und rosazea klinisch \\[5pt]
a granulome, b pusteln, c erytheme, d papeln, e comedone

\section*{answer:}
c erytheme

\section*{explanation:}
acne vulgaris and rosacea are two common skin conditions that can sometimes be confused with each other however, they have distinct clinical features acne vulgaris is characterized by the presence of comedones (open or closed), papules, pustules, and occasionally nodules and cysts on the other hand, rosacea primarily presents with persistent erythema (redness) on the central face, flushing, and telangiectasia (visible blood vessels) while both conditions can have inflammatory lesions, acne vulgaris is more likely to have comedones and pustules, while rosacea is more likely to present with erythema
