\question{bei welcher erkrankung sind papeln vorzufinden a psoriasis, b herpes zoster, c lichen planus}

the papules are small, solid, raised bumps on the skin they can appear in various forms and sizes, but they are usually less than 1 cm in diameter papules can be a symptom of many different skin conditions

a) psoriasis is a chronic skin condition that occurs when skin cells grow too quickly and build up into bumpy red patches with white scales these patches can be itchy or painful and sometimes crack and bleed the most common type of psoriasis is plaque psoriasis, characterized by red, inflamed patches covered with silvery scales however, papules are not the primary lesion in psoriasis; they may appear as part of the condition but are not a defining feature

b) herpes zoster, also known as shingles, is caused by the varicella-zoster virus, which also causes chickenpox after a person recovers from chickenpox, the virus remains inactive in their nerve tissue and can reactivate later, causing shingles shingles typically cause a painful rash that develops into fluid-filled blisters, which eventually crust over and scab while herpes zoster may present with papules during the early stages of the rash, they are not the primary identifying feature

c) lichen planus is an inflammatory condition that can affect the skin, mouth, scalp, and genitals the most common form affects the skin, causing purplish, flat-topped papules that often have a shiny surface these papules are usually small (less than 1 cm in diameter) and may be found on the wrist, forearm, ankle, or lower leg they can also appear on the mucous membranes inside the mouth, causing painful sores

therefore, the correct answer is c lichen planus
